import React, { useEffect, useState } from "react"
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { useDispatch, useSelector } from "react-redux";
import { dialogClasses } from "@mui/material";
import { getData } from '../redux/actions'



function Dish() {

    let image
    let ingridient = []
    const dispatch = useDispatch();
    const dataDish = useSelector(state => state.dish.data)
    console.log(dataDish);

    useEffect(() => {
        dispatch(getData())
    }, [dispatch])

    if (dataDish) {
        (dataDish.meals[0].strMealThumb !== undefined) ? image = dataDish.meals[0].strMealThumb :
            image = 'https://res.cloudinary.com/crunchbase-production/image/upload/c_lpad,f_auto,q_auto:eco,dpr_1/v1479829522/bxpgav8mvdsibvxctd1d.jpg'
        for (let i = 1; i <= 20; i++) {
            if ((dataDish.meals[0].strIngredient + i).lenth > 1) {
                ingridient.push((dataDish.meals[0].strIngredient + i));
            }
        }
        console.log(ingridient);
    }

    // for (let i = 1; i <= 20; i++) {
    //     if ((dataDish.meals[0].strIngredient + i).lenth > 1){
    //         ingridient.push((dataDish.meals[0].strIngredient + i);
    //     }
    // }

    return (
        (dataDish !== undefined) ?
            <div className="dishItems">
                <Card sx={{ maxWidth: 345 }}>
                    <CardMedia
                        component="img"
                        height="160"
                        image={image}
                        alt="" />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            {dataDish.meals[0].strArea} , {dataDish.meals[0].strCategory}
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                            Ingredients :
                            {dataDish.meals[0].strIngredient1},
                            {dataDish.meals[0].strIngredient2},
                            {dataDish.meals[0].strIngredient3},
                            {dataDish.meals[0].strIngredient4},
                            {dataDish.meals[0].strIngredient5},
                            {dataDish.meals[0].strIngredient6},
                            {dataDish.meals[0].strIngredient7},
                            {dataDish.meals[0].strIngredient8},
                            {dataDish.meals[0].strIngredient9},
                            {dataDish.meals[0].strIngredient10},
                            {dataDish.meals[0].strIngredient11},
                            {dataDish.meals[0].strIngredient12},
                            {dataDish.meals[0].strIngredient13},
                            {dataDish.meals[0].strIngredient14},
                            {dataDish.meals[0].strIngredient15},
                            {dataDish.meals[0].strIngredient16},
                            {dataDish.meals[0].strIngredient17},
                            {dataDish.meals[0].strIngredient18},
                            {dataDish.meals[0].strIngredient19},
                            {dataDish.meals[0].strIngredient20}
                        </Typography >
                    </CardContent >
                    <CardActions>
                        <Button size="small">Skip</Button>
                        <Button size="small">Like </Button>
                    </CardActions>
                </Card >
            </div >
            : <div> pusto </div>
    )

}





export default Dish;
